;; **
;;; ## Statistics
;; **

;; @@
(table/table-view 
  (map 
    (fn [[k v]] 
      (concat [(element-name k)] (format-to-table-view v))) 
    (zipmap nodes (map #(degree t0 tmax :statistics %) nodes))) 
  :columns table-columns)
